import React from "react";
import "./LandingBtn.css";
import "../../components/Landingpage/LandingBtn.css";
import Game from "../../components/game/game.js";
// The ...props means, spread all of the passed props onto this element
// That way we don't have to define them all individually
class LandingBtn extends Component {
  render() {
      return (
          <footer className='landing-btn'>
              <div className='btn'>
                  Powered By<img src={img} className='landing-btn' alt='logo'/><a href='https://github.com/abalomenos' target='_blank' rel='noopener noreferrer'>Argiris Balomenos</a>
              </div>
          </footer>
      );
  }
}
export default LandingBtn;
